import React from "react";



const HogTile = ({ hogs }) => {
  return (
    <div className="indexWrapper">
      <ul>
        {hogs.map(hog => {
          return (
            <li className="pigTile">
              <h3>{hog.name}</h3>
            </li>
          );
        })}
      </ul>
    </div>
  );
};

export default HogTile;
